import React, { Component } from 'react'
import './ReadRoom.css'
class ReadRoom extends React.Component {
    render(){
        return(
            <div className='row' style={{height:'100vh', padding:'10px'}}>
                <div className="row" align="center">
                    <div className="col-sm-12">
                        {this.props.title}
                    </div>
                </div>
                <div className="row">
                <div className="col-sm-3" id={`view${this.props.id}`}>
<br/>            






                </div>


                <div className="col-sm-6" id="notes">
                    <input type="textarea" style={{border:'0px', width:'100%', height:''}}></input>
                </div>


                <div className="col-sm-3" id="dictionary"></div>
            </div>
            </div>

        )
    }
}

export default ReadRoom;
